import React from 'react';

import { makeStyles } from '@material-ui/core/styles';
import { Grid, GridList, GridListTile, Typography } from '@material-ui/core';

import { Parallax, Background } from 'react-parallax';

const tileData = [
    {
        img: `http://www.daveallenphotography.com/gallery/l_summer_laurel_blue_ridge_parkway_nc.jpg`,
        title: 'Blue Ride Parkway',
        author: '',
        cols: 2,
        strength: 100
    },
    {
        img: `https://greenvillejournal.com/wp-content/uploads/2018/10/iStock-865192838.jpg`,
        title: 'Blue Ridge Parkway',
        author: '',
        cols: 1,
        strength: 150
    },
    {
        img: `https://www.nps.gov/articles/images/BLRI_Standing_Rock_Overlook_nocover.jpg?maxwidth=650&autorotate=false`,
        title: 'Blue Ridge Parkway',
        author: '',
        cols: 1,
        strength: 100
    },
    {
        img: `https://upload.wikimedia.org/wikipedia/commons/thumb/b/b6/Blue_Ridge_Parkway_in_Fall.jpg/300px-Blue_Ridge_Parkway_in_Fall.jpg`,
        title: 'Blue Ridge Parkway',
        author: '',
        cols: 1,
        strength: 150
    },
    {
        img: `https://photorator.com/photos/images/burnett-reservoir-as-viewed-from-above-on-the-blue-ridge-parkway-north-carolina--81832.jpg`,
        title: 'Blue Ridge Parkway',
        author: '',
        cols: 1,
        strength: 100
    },
    {
        img: `https://assets.simpleviewinc.com/simpleview/image/upload/c_fill,h_474,q_75,w_640/v1/clients/newyorkstate/AD_2015_122_44de426d-7824-4c67-8331-32143c83903e.jpg`,
        title: 'Blue Ridge Parkway',
        author: '',
        cols: 1,
        strength: 150
    },
    {
        img:  `https://www.blueridgemountains.com/imager/s3_amazonaws_com/blueridge-2018/images/1920-width/iStock-134561164_5ac8ae049534b01c104dc4019c5230ff.jpg`,
        title: 'Blue Ridge Parkway',
        author: '',
        cols: 2,
        strength: 100
    }
]

const useStyles = makeStyles(theme => ({
    containers: {
        width: '100vw', 
        height: '80vh',
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
    },
    infoText: {
        width: '70%',
    },
}));

const ImageList = () => {

    const classes = useStyles();

    return (

        <Grid container>

            <Grid className={classes.containers} item xs={6}>

                <Parallax 
                    strength={200}
                    style={{
                        width: '100%',
                        height: '100%'
                    }}
                    bgStyle={{
                        width: '100%',
                        top: '40%'
                    }}
                >

                    <Background style={{ width: '100%', height: '100%' }}>
                        <img style={{ width: 600, height: 300, borderRadius: '4px' }} src={`http://www.daveallenphotography.com/gallery/l_summer_laurel_blue_ridge_parkway_nc.jpg`} />
                    </Background>

                </Parallax>

            </Grid>
            <Grid style={{ width: '100vw', height: '80vh' }} item xs={6}>

                <Parallax 
                    strength={200}
                    style={{
                        width: '100%',
                        height: '100%'
                    }}
                    bgStyle={{
                        width: '100%',
                        top: '40%'
                    }}
                >

                    <Background style={{ width: '100%', height: '100%' }}>
                        <Typography className={classes.infoText} variant="h6" align="center">
                            The Blue Ridge Parkway is a ribbon of road that weaves through 
                            the region’s vibrant living traditions. From Cherokee life and 
                            agricultural history to Southern Appalachian crafts and music, 
                            the Parkway’s 469 miles through Virginia and North Carolina offer 
                            many ways to explore rich traditions.
                        </Typography>
                    </Background>

                </Parallax>

            </Grid>

        </Grid>

    );
};

export default ImageList;
